@AbapCatalog.sqlViewName: 'ZBSAD'
@EndUserText.label: 'Acctg: Index for Customers (Clrd Items)'
@AccessControl.authorizationCheck: #NOT_REQUIRED
@ObjectModel.usageType.serviceQuality: #B
@ObjectModel.usageType.dataClass: #TRANSACTIONAL
@ObjectModel.usageType.sizeCategory: #XL
@AbapCatalog.preserveKey: true
@AbapCatalog.viewEnhancementCategory: [#NONE]

define view  ZBSAD_DDL
 as select
 key bukrs, key kunnr, key umsks, key umskz, key augdt, key augbl, key zuonr, key gjahr, key belnr, key buzei,
   budat,   bldat,   cpudt,
   @Semantics.currencyCode waers,
   xblnr, blart, monat, bschl, zumsk, shkzg, gsber,
   tax_country, mwskz, txdat_from,
   @Semantics.amount.currencyCode: 'T001.WAERS' dmbtr,
   @Semantics.amount.currencyCode: 'WAERS'      wrbtr,
   @Semantics.amount.currencyCode: 'RFCCUR' cast(0 as fins_vfccur12) as fcsl,
   @Semantics.currencyCode cast('     ' as fins_currfc) as rfccur,
   @Semantics.amount.currencyCode: 'T001.WAERS' mwsts,
   @Semantics.amount.currencyCode: 'WAERS'      wmwst,
   @Semantics.amount.currencyCode: 'T005.WAERS' lwsts,
   @Semantics.amount.currencyCode: 'T001.WAERS' bdiff,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' bdif2,
   sgtxt, projn, aufnr, anln1,
   anln2,   saknr,   hkont, fkont, filkd, zfbdt, zterm, zbd1t, zbd2t, zbd3t, zbd1p,
   zbd2p,
   @Semantics.amount.currencyCode: 'WAERS'      skfbt,
   @Semantics.amount.currencyCode: 'T001.WAERS' sknto,
   @Semantics.amount.currencyCode: 'WAERS'      wskto,
   zlsch,
   zlspr,   zbfix, hbkid, bvtyp, rebzg, rebzj,
   rebzz,   samnr,   anfbn, anfbj, anfbu, anfae, mansp, mschl, madat, manst, maber,
   xnetb,   xanet,   xcpdd, xinve, xzahl, mwsk1, txdat_from1, tax_country1,
   @Semantics.amount.currencyCode: 'T001.WAERS' dmbt1,
   @Semantics.amount.currencyCode: 'WAERS'      wrbt1, hist_tax_factor1,
   mwsk2, txdat_from2, tax_country2,
   @Semantics.amount.currencyCode: 'T001.WAERS' dmbt2,
   @Semantics.amount.currencyCode: 'WAERS'      wrbt2, hist_tax_factor2,
   mwsk3, txdat_from3, tax_country3,
   @Semantics.amount.currencyCode: 'T001.WAERS' dmbt3,
   @Semantics.amount.currencyCode: 'WAERS'      wrbt3, hist_tax_factor3, hist_tax_factor,
   bstat, vbund, vbeln, rebzt, infae, stceg, egbld, eglld,
   rstgr,   xnoza,
   vertt,   vertn, vbewa, wverw, projk, fipos, nplnr, aufpl, aplzl,
   xegdr,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' dmbe2,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' dmbe3,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' dmb21,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' dmb22,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' dmb23,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' dmb31,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' dmb32,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' dmb33,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' bdif3,
   xragl,
   uzawe,   xstov,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' mwst2,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' mwst3,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' sknt2,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' sknt3,
   xref1, xref2, xarch,
   @Semantics.currencyCode pswsl,
   @Semantics.amount.currencyCode: 'PSWSL' pswbt,
   lzbkz,   landl,   imkey, vbel2, vpos2,
   posn2,   eten2, fistl, geber, dabrz, xnegp,
   kostl,   rfzei,   kkber, empfb, prctr, xref3, qsskz, zinkz, dtws1, dtws2, dtws3,
   dtws4,   xpypr,   kidno,
   @Semantics.amount.currencyCode: 'T014.WAERS' absbt,
   ccbtc,
   @Semantics.currencyCode pycur,
   @Semantics.amount.currencyCode: 'PYCUR' pyamt,
   bupla, secco, cession_kz,
   @Semantics.amount.currencyCode: 'T001.WAERS' ppdiff,
   @Semantics.amount.currencyCode: 'BKPF.HWAE2' ppdif2,
   @Semantics.amount.currencyCode: 'BKPF.HWAE3' ppdif3,
   kblnr, kblpos, grant_nbr, gmvkz, srtype, lotkz, fkber, intreno, pprct,
   buzid,   auggj,   hktid, budget_pd, 
   cast('          ' as psm_bdgt_account preserving type) as bdgt_account,
   cast('          ' as fagl_re_account preserving type) as re_account,
   pays_prov, pays_tran, mndid, 
   cast('    ' as farp_payt_rsn preserving type) as payt_rsn,
   _dataaging,
   cast('  ' as kontt_fi preserving type) as kontt,
   cast('                                                  ' as kontl_fi preserving type) as kontl,
   cast('00000000' as uebgdatum) as uebgdat,
   vname,
   egrup,
   btype,
   propmano,
//<$VF>
//<$FIELDS>
//<$VF>
   gkont, gkart, ghkon,
   cast('     ' as awtyp preserving type)      as awtyp,
   cast('          ' as logsystem_sender preserving type) as logsystem_sender,
   cast('    '       as bukrs_sender preserving type) as bukrs_sender,
   cast('          ' as belnr_sender preserving type) as belnr_sender,
   cast('0000'       as gjahr_sender preserving type) as gjahr_sender,
   cast('000'        as buzei_sender preserving type) as buzei_sender,
   cast(0 as pdays) as pendays,
   cast( '     ' as bcode preserving type ) as j_1tpbupl
  from bsad_bck where xarch = 'X'
  union all
 select
    key i.bukrs, key i.kunnr, key i.umsks, key i.umskz, key i.augdt, key i.augbl, key i.zuonr,
    key i.gjahr, key i.belnr, key i.buzei, i.h_budat as budat, i.h_bldat as bldat, h.cpudt,
    @Semantics.currencyCode i.h_waers as waers,
    h.xblnr, i.h_blart as blart, i.h_monat as monat, i.bschl, i.zumsk, i.shkzg, i.gsber, i.tax_country, i.mwskz, i.txdat_from,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.dmbtr,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wrbtr,
    @Semantics.amount.currencyCode: 'RFCCUR'     i.fcsl,
    @Semantics.currencyCode                      i.rfccur,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.mwsts,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wmwst,
    @Semantics.amount.currencyCode: 'T005.WAERS' i.lwsts,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.bdiff,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.bdif2,
    i.sgtxt, i.projn, i.aufnr, i.anln1, i.anln2, i.saknr, i.hkont, i.fkont,
    i.filkd, i.zfbdt, i.zterm, i.zbd1t, i.zbd2t, i.zbd3t, i.zbd1p, i.zbd2p,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.skfbt,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.sknto,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wskto,
    i.zlsch, i.zlspr, i.zbfix, i.hbkid, i.bvtyp, i.rebzg, i.rebzj, i.rebzz,
    i.samnr, i.anfbn, i.anfbj, i.anfbu, i.anfae, i.mansp, i.mschl, i.madat,
    i.manst, i.maber, h.xnetb, i.xanet, i.xcpdd, i.xinve, i.xzahl, i.mwsk1, i.txdat_from1, i.tax_country1,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.dmbt1,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wrbt1, i.hist_tax_factor1,
    i.mwsk2, i.txdat_from2, i.tax_country2,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.dmbt2,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wrbt2, i.hist_tax_factor2,
    i.mwsk3, i.txdat_from3, i.tax_country3,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.dmbt3,
    @Semantics.amount.currencyCode: 'BKPF.WAERS'      i.wrbt3, i.hist_tax_factor3, i.hist_tax_factor,
    i.h_bstat as bstat, i.vbund, i.vbeln, i.rebzt, cast('        ' as infae preserving type) as infae,   i.stceg, i.egbld, i.eglld,
    i.rstgr, cast('' as xnoza preserving type) as xnoza,   i.vertt, i.vertn, i.vbewa, i.wverw, i.projk, i.fipos,
    i.nplnr, i.aufpl, i.aplzl, i.xegdr,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.dmbe2,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.dmbe3,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.dmb21,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.dmb22,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.dmb23,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.dmb31,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.dmb32,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.dmb33,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.bdif3,
    i.xragl, i.uzawe, h.xstov,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.mwst2,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.mwst3,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.sknt2,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.sknt3,
    i.xref1, i.xref2, cast(case i._dataaging when '00000000' then '' else 'X' end as xarch preserving type) as xarch,
    @Semantics.currencyCode i.pswsl,
    @Semantics.amount.currencyCode: 'PSWSL' i.pswbt,
    i.lzbkz, i.landl, i.imkey, i.vbel2, cast('000000' as num06 preserving type) as vpos2,
    i.posn2, i.eten2, i.fistl, i.geber, i.dabrz, i.xnegp,
    i.kostl, i.rfzei, i.kkber, i.empfb, i.prctr, i.xref3,
    i.qsskz, i.zinkz, i.dtws1, i.dtws2, i.dtws3,
    i.dtws4, i.xpypr, i.kidno,
    @Semantics.amount.currencyCode: 'T014.WAERS' i.absbt,
    i.ccbtc,
    @Semantics.currencyCode i.pycur,
    @Semantics.amount.currencyCode: 'PYCUR' i.pyamt,
    i.bupla, i.secco, i.cession_kz,
    @Semantics.amount.currencyCode: 'T001.WAERS' i.ppdiff,
    @Semantics.amount.currencyCode: 'BKPF.HWAE2' i.ppdif2,
    @Semantics.amount.currencyCode: 'BKPF.HWAE3' i.ppdif3,
    i.kblnr, i.kblpos, i.grant_nbr, i.gmvkz, i.srtype, h.lotkz,
    cast(case i.fkber_long when ' '
      then i.fkber
      else i.fkber_long
    end as fkber preserving type) as fkber,
    i.intreno, i.pprct, i.buzid, i.auggj, i.hktid, i.budget_pd, 
    i.bdgt_account,
    i.re_account,
    i.pays_prov,
    i.pays_tran, i.mndid,
    i.payt_rsn,
    i._dataaging,
    i.kontt,
    i.kontl,
    cast('00000000' as uebgdatum) as uebgdat,
    i.vname,
    i.egrup,
    i.btype,
    h.propmano,
//<$VF_PREFIX>
//<$FIELDS_PREFIX>
//<$VF_PREFIX>
    i.gkont, i.gkart, i.ghkon,
    h.awtyp,
    h.logsystem_sender,
    h.bukrs_sender,
    h.belnr_sender,
    h.gjahr_sender,
    i.buzei_sender,
    i.pendays,
    i.j_1tpbupl    
    /* , i.kontt,  i.kontl, '00000000'  as uebgdat, i.vname, i.egrup,
    i.btype,  h.propmano */
   from bseg i left outer join bkpf h
     on h.mandt = i.mandt
     and h.bukrs = i.bukrs
     and h.gjahr = i.gjahr
     and h.belnr = i.belnr
   where i.koart = 'D'
   and i.augbl <> ''
   and i.h_bstat <> 'D'
   and i.h_bstat <> 'M'



